%spark

var df2 = df.withColumn("filename", input_file_name()).withColumnRenamed("_lat","lat").withColumnRenamed("_lon","lon")

//use regexp to extract ATHLETE and ACTIVITYTYPE
//hint: here is a great site: https://regexr.com/
// use this as a sample filename hdfs://dcbjan4-bdcsce-1.compute-gse00010212.oraclecloud.internal:8020/user/zeppelin/strava/raw/DBAYARDSMALL/20180101-143310-Run.gpx
//note: we added an extra \ to escape the \ character in scala quotes
df2 = df2.withColumn("athlete",regexp_extract(col("filename"),"""(\w+(?=\/\d*-\d*-.*gpx))""",1)).withColumn("activityType",regexp_extract(col("filename"),"(\\w+(?=\\.gpx))",1)).withColumn("activityName",regexp_extract(col("filename"),"""(\w*-\w*-\w*(?=\.gpx))""",1))
//df2 = df2.withColumn("athlete",lit("dbayard")).withColumn("activityType",regexp_extract(col("filename"),"(\\w+)",1))


//df2 = df2.select(df2.col("athlete"),df2.col("activityType"),df2.col("time"),df2.col("lat"),df2.col("lon"),df2.col("ele"))
df2 = df2.select(df2.col("athlete"),df2.col("activityType"),df2.col("activityName"),df2.col("time"),df2.col("lat"),df2.col("lon"),df2.col("ele"),df2.col("extensions.gpxtpx:TrackPointExtension.gpxtpx:hr").alias("heart_rate"))


df2.printSchema()

df2.first()

